CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_resgistro_poas`(
in _antecedentes    text,
	in _result_obt    text,
	in _justificacion    text,
	in _fundamento_legal    text,
	in _desc_prob    text,
	in _obj_gral    text,
	in _obj_esp    text,
	in _fecha_ini    date,
	in _fecha_fin    date,
	in _sit_actual    text,
	in _estrategias    text,
	in _sit_esperada    text,
	in _lineas_accion    text,
	in _cobertura    text,
	in _poblacion_bene    text,
	in _poblacion_obj    text,
	in _carac_poblacion    text,
	in _prenatal_h    int,
	in _ninos_h    int,
	in _adolcesc_h    int,
	in _joven_h    int,
	in _adulto_h    int,
	in _mayor_h    int,
	in _prenatal_m    int,
	in _ninos_m    int,
	in _adolcesc_m    int,
	in _joven_m    int,
	in _adulto_m    int,
	in _mayor_m    int,
	in _impacto_soc    text,
	in _monto_pres    float,
	in _fuente_fin    varchar(100),
	in _ene    int,
	in _feb    int,
	in _mar    int,
	in _abr    int,
	in _may    int,
	in _jun    int,
	in _jul    int,
	in _ago    int,
	in _sep    int,
	in _oct    int,
	in _nov    int,
	in _dic    int,
	in _nom_indicador    varchar(100),
	in _unidad_medida    varchar(100),
	in _periodo_verif    text,
	in _formula    text,
	in _meta    text,
	in _id_user    int
)
BEGIN

	DECLARE id_datos_gral    int;
	DECLARE id_estructura_financiera    int;
	DECLARE id_poblacion_beneficiada    int;
	DECLARE id_indicadores    int;
	DECLARE id_carta_descriptiva    int;
	DECLARE msg varchar(100);
    
    
    
    
    

		DECLARE EXIT HANDLER FOR SQLEXCEPTION 
		BEGIN
			ROLLBACK;
			SELECT FALSE AS result;
		END;
        
        START TRANSACTION;
        INSERT INTO datos_gral (antecedentes, descripcion_prob, res_obt_ant, obj_gral, justificacion, obj_esp,fund_legal, fecha_ini, fecha_fin) 
		VALUES ( _antecedentes, _desc_prob,  _result_obt, _obj_gral, _justificacion, _obj_esp, _fundamento_legal, _fecha_ini, _fecha_fin);
		
	
		SELECT  id_datos_gral = MAX(id) FROM datos_gral;
		

		INSERT INTO estructura_financiera (monto_pres, fuente_financiamiento,ene,feb,mar,abr,may,jun,jul,ago,sep,oct,nov,dic) 
		VALUES ( _monto_pres, _fuente_fin, _ene, _feb, _mar, _abr, _may, _jun, _jul, _ago, _sep, _oct, _nov, _dic);
		

		SELECT  id_estructura_financiera = MAX(id) FROM estructura_financiera;
		
	
		INSERT INTO poblacion_beneficiada (cobertura, pobl_obj, pobl_ben, caracteristicas, prenatal_h, prenatal_m,ninios_h,ninios_m,adol_h,adol_m,jov_h,jov_m,adul_h,adul_m,may_h,may_m,imp_social) 
		VALUES ( _cobertura, _poblacion_obj, _poblacion_bene, _carac_poblacion, _prenatal_h, _prenatal_m, _ninos_h, _ninos_m, _adolcesc_h, _adolcesc_m, _joven_h, _joven_m, _adulto_h, _adulto_m, _mayor_h, _mayor_m, _impacto_soc);		

		SELECT  id_poblacion_beneficiada = MAX(id) FROM poblacion_beneficiada;
		

		INSERT INTO indicadores (nombre, formula,unidad_med,meta,periodo_ver) 
		VALUES ( _nom_indicador, _formula, _unidad_medida, _meta, _periodo_verif);
		

		SELECT  id_indicadores = MAX(id) FROM indicadores;

		INSERT INTO carta_descriptiva (sit_actual, sit_esp, estrategias, lin_accion) 
		VALUES ( _sit_actual, _sit_esperada, _estrategias, _lineas_accion);
		

		SELECT  id_carta_descriptiva = MAX(id) FROM carta_descriptiva;

		INSERT INTO info_sub_programas (id_cat_sub_programa,id_datos_gral,id_estructura_financiera,id_poblacion_beneficiada, id_indicadores,id_carta_descriptiva,id_usuario) 
		VALUES (null, id_datos_gral, id_estructura_financiera, id_poblacion_beneficiada, id_indicadores, id_carta_descriptiva, _id_user);

		COMMIT;
        
        SELECT TRUE AS result;

END ;;
